import React, { useState } from "react";

function Section() {
  const [load, setLoad] = useState(true);

  return (
    <div>
      {load ? (
        <button onClick={() => setLoad(false)} className="btn bg-primary">
          Load More
        </button>
      ) : (
        <Card />
      )}
    </div>
  );
}

export default Section;
